import React from 'react';
import Link from 'next/link';


const Home = () => (    
    <div className="homepage">
        This is home page

        <Link href="/[country]" as="/us">
            <a>Click to next</a>
        </Link>


    <style jsx>{`

        .homepage{
            background-image: url('../images/blog-2.jpg');
            height: 1300px;
        }
    
    `}</style>
    </div>
)

export default Home;
